import React from 'react'
import arraypic from '../pics/arrayimg1.png'; 
import {Link} from 'react-router-dom';

 const Home = () => {
  return (
    <div>
      <Link to="/options">
  <img src={arraypic} alt="array logo"/>
      </Link>
      </div>
  )
}


export default Home;
